msg.channel.send(`Witaj w ustawieniach autoroli.\nProszƒô teraz podaƒá wzmiankƒô lub nazwƒô roli (wielko≈õƒá liter ma znaczenie) wraz z emotkƒÖ.\nNp. @rola/rola ‚úÖ`)
    .then((message) => {
        msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                max: 1,
                time: 60000,
                errors: ['time'],
            })
