                msg.author.lastMessage.delete();
                if (collected.first().content.split(/ +/g).length > 1) {
                    if (collected.first().content.split(/ +/g)[0] != null) {
                        const tstValidRole = await msg.guild.roles.find(role => role.name === collected.first().content.split(/ +/g)[0]);
                        if (collected.first().mentions.roles.first() || tstValidRole != null) {
                            var unicodeStored = collected.first().content.split(/ +/g)[1];
                            var roleMentioned;
                            if (collected.first().mentions.roles.first() != null) {
                                roleMentioned = collected.first().mentions.roles.first();
                            } else {
                                roleMentioned = tstValidRole;
                            }
                            if (unicodeStored.charCodeAt(0 > 127)) {
                                reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                emojiArray.push(unicodeStored);
                                roleArray.push(roleMentioned.id);
                                message.edit(`Wybra≈Çe≈õ/a≈õ rolƒô **${roleMentioned.name}** na reakcjƒô ${unicodeStored}.\nJe≈õli wszystko siƒô zgadza proszƒô wpisaƒá "potwierdz".\nJe≈õli nie proszƒô pisaƒá "anuluj", aby anulowaƒá akcjƒô.`);
                                msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                                        max: 1,
                                        time: 60000,
                                        errors: ['time'],
                                    })
                                    .then((collected) => {
                                        msg.author.lastMessage.delete();
                                        if (collected.first().content.toLowerCase() == "potwierdz") {
                                            reAsk(message)
                                        } else if (collected.first().content.toLowerCase() == "anuluj") {
                                            message.delete();
                                            msg.channel.send("Akcja zosta≈Ça anulowana.\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                                        } else {
                                            message.delete();
                                            msg.channel.send("Akcja zosta≈Ça odwo≈Çana, poda≈Çe≈õ/a≈õ niepoprawne dane!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                                        }
                                    }).catch(() => {
                                        message.delete();
                                        msg.channel.send('Niestety czas na podanie danych siƒô sko≈Ñczy≈Ç.\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !');
                                    });
                            } else {
                                message.delete();
                                msg.channel.send("Akcja zosta≈Ça odwo≈Çana, poda≈Çe≈õ/a≈õ niepoprawnƒÖ emotkƒô!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                            }

                        } else {
                            message.delete();
                            msg.channel.send("Akcja zosta≈Ça odwo≈Çana, poda≈Çe≈õ/a≈õ niepoprawnƒÖ odpowied≈∫!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                        }
                    } else {
                        message.delete();
                        msg.channel.send("Akcja zosta≈Ça odwo≈Çana, poda≈Çe≈õ/a≈õ niepoprawnƒÖ rolƒô!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                    }
                } else {
                    message.delete();
                    msg.channel.send("Akcja zosta≈Ça odwo≈Çana, nie poda≈Çe≈õ/a≈õ reakcji/roli!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                }
            }).catch((error) => {
                console.log(error);
                message.delete();
                msg.channel.send('Czas na podanie danych siƒô sko≈Ñczy≈Ç!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !');
            });
    })

function reAsk(message) {
    if (reactionArray.length != 10) {
        var finalText = "";
        reactionArray.forEach(subarray => {
            finalText = finalText + `${subarray[0]} => ${subarray[2]}\n`
        })
        message.edit(`Do tej pory masz tyle roli na reakcjƒô (max 10)\n ${finalText}\n\nJe≈õli chcesz do≈ÇƒÖczyƒá kolejnƒÖ rolƒô na reakcjƒô wpisz rolƒô wraz z reakcjƒÖ jak poprzednio.\nJe≈õli nie proszƒô wpisaƒá "koniec".\nJe≈õli chcesz anulowaƒá wpisz "anuluj"`);
        msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                max: 1,
                time: 60000,
                errors: ['time'],
            })
            .then(async function(collected) {
                msg.author.lastMessage.delete();
                if (collected.first().content.toLowerCase() == "koniec") {
                    done(message)
                } else if (collected.first().mentions.roles.first() == "anuluj") {
                    message.delete();
                    msg.channel.send("Akcja zosta≈Ça odwo≈Çana.\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                } else {
                    if (collected.first().content.split(/ +/g).length > 1) {
                        const tstValidRole = await msg.guild.roles.find(role => role.name === collected.first().content.split(/ +/g)[0]);
                        if (collected.first().mentions.roles.first() || tstValidRole != null) {
                            var unicodeStored = collected.first().content.split(/ +/g)[1];
                            if (collected.first().mentions.roles.first() != null) {
                                roleMentioned = collected.first().mentions.roles.first();
                            } else {
                                roleMentioned = tstValidRole;
                            }
                            if (unicodeStored != null) {
                                if (!emojiArray.includes(unicodeStored)) {
                                    if (!roleArray.includes(roleMentioned.id)) {
                                        if (unicodeStored.charCodeAt(0 > 127)) {
                                            reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                            emojiArray.push(unicodeStored);
                                            roleArray.push(roleMentioned.id);
                                            reAsk(message)
                                        } else {
                                            message.delete();
                                            msg.channel.send("Akcja zosta≈Ça odwo≈Çana, poda≈Çe≈õ reakcjƒô, kt√≥ra zosta≈Ça ju≈º u≈ºyta!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                                        }
                                    } else {
                                        message.delete();
                                        msg.channel.send("Akcja zosta≈Ça odwo≈Çana, poda≈Çe≈õ/a≈õ rolƒô, kt√≥ra zosta≈Ça u≈ºyta!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                                    }
                                } else {
                                    message.delete();
                                    msg.channel.send("Akcja zosta≈Ça odwo≈Çana, poda≈Çe≈õ/a≈õ niepoprawnƒÖ reakcjƒô!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                                }
                            }
                        } else {
                            message.delete();
                            msg.channel.send("Akcja zosta≈Ça odwo≈Çana, poda≈Çe≈õ/a≈õ nieprawid≈ÇowƒÖ rolƒô!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                        }
                    } else {
                        message.delete();
                        msg.channel.send("Akcja zosta≈Ça odwo≈Çana, poda≈Çe≈õ/a≈õ nieprawid≈ÇowƒÖ reakcjƒô/rolƒô!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
                    }
                }
            }).catch(() => {
                message.delete();
                msg.channel.send('Czas na podanie danych siƒô sko≈Ñczy≈Ç!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !');
            });
    } else {
        done(message);
    }

}

function done(message) {
    var finalText = "";
    reactionArray.forEach(subarray => {
        finalText = finalText + `${subarray[0]} => ${subarray[2]}\n`
    })
    message.edit(`Ostateczna konfiguracja menu\n\nPoni≈ºej znajduje siƒô lista ustawionych reakcji na rolƒô\n${finalText}\n\nJe≈õli jest poprawna proszƒô wpisaƒá wzmiankƒô kana≈Çu (na tym serwerze),  na kt√≥rym ma zostaƒá wys≈Çanne menu z rolami.\nJe≈õli menu nie jest poprawne proszƒô anulowaƒá wpisujƒÖc "anuluj".`)
    msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
            max: 1,
            time: 60000,
            errors: ['time'],
        })
        .then((collected) => {
            msg.author.lastMessage.delete();
            if (collected.first().mentions.channels.first()) {
                var menchannel = collected.first().mentions.channels.first()
                message.delete();
                menchannel.send({
                        embed: {
                            color: 0xffff00,
                            title: "Menu Roli",
                            description: `Zareaguj, na kt√≥rƒÖ≈õ z poni≈ºszych reackji, aby otrzymaƒá przypisanƒÖ do niej rolƒô\n${finalText}`,
                            timestamp: new Date()
                        }
                    })
                    .then(embedmessage => {
                        reactionArray.forEach(async function(subarray) {
                            await embedmessage.react(subarray[0])
                        })
                        rectarray.push({
                            [embedmessage.id]: reactionArray
                        })
                        _this.storeValue(rectarray, 3, "reactionRoleInf", cache);
                        _this.callNextAction(cache);
                    })
            } else if (collected.first().content == "anuluj") {
                message.delete();
                msg.channel.send("Akcja zosta≈Ça anulowana.\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
            } else {
                message.delete();
                msg.channel.send("Akcja zosta≈Ça anulowana, Nie poda≈Çe≈õ/a≈õ poprawnych danych!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !");
            }
        }).catch(() => {
            message.delete();
            msg.channel.send('Czas na podanie danych minƒÖ≈Ç!\nProszƒô wpisaƒá komendƒô ponownie, aby spr√≥bowaƒá ustawiƒá !');
        });
}

